**Prerequisites**

1. Install Rust: Follow the instructions on the official Rust installation page to install Rust on your system.
2. Create an account on ElevenLabs: Sign up for an account on ElevenLabs to obtain an API key.
3. Install the required dependencies: You'll need to add the following dependencies to your `Cargo.toml` file:
```toml
[dependencies]
