**Step 1: Set up the ElevenLabs API client**

Create a new file called `elevenlabs.rs` and add the following code:
```rust
use reqwest::Client;
use serde::{Deserialize, Serialize};

#[derive(Serialize, Deserialize)]
struct ElevenLabsConfig {
    api_key: String,
}

impl ElevenLabsConfig {
    fn new(api_key: String) -> Self {
        ElevenLabsConfig { api_key }
    }
}

pub struct ElevenLabsClient {
    client: Client,
    config: ElevenLabsConfig,
}

impl ElevenLabsClient {
    pub fn new(config: ElevenLabsConfig) -> Self {
        let client = Client::new();
        ElevenLabsClient { client, config }
    }

    pub async fn get_text(&self, text: String) -> Result<String, reqwest::Error> {
        let url = format!("https://api.elevenlabs.io/v1/text-to-speech?text={}&voice=en-US", text);
        let headers = reqwest::header::HeaderMap::new();
        headers.insert(reqwest::header::AUTHORIZATION, format!("Bearer {}", self.config.api_key).parse().unwrap());
        let response = self.client.get(url).headers(headers).send().await?;
        let response_text = response.text().await?;
        Ok(response_text)
    }
}
```
This code sets up an ElevenLabs API client using the `reqwest` crate. You'll need to replace `YOUR_API_KEY` with your actual API key.

